import React from "react";
import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <nav style={{ backgroundColor: "#333", padding: "10px" }}>
      <Link to="/" style={{ color: "white", margin: "10px", textDecoration: "none" }}>
        Liste des Voitures
      </Link>
      <Link to="/ajouter" style={{ color: "white", margin: "10px", textDecoration: "none" }}>
        Ajouter une Voiture
      </Link>
    </nav>
  );
}
